// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CarbonCredit {
    address private _owner;
    uint256 private _currentTokenId;

    struct CreditDetails {
        string origin;
        string certificationStandard;
        string projectDetails;
        uint256 environmentalImpact;
        bool retired;
    }

    mapping(uint256 => address) private _tokenOwners;
    mapping(uint256 => CreditDetails) public creditDetails;

    event CreditMinted(uint256 tokenId, address owner, CreditDetails details);
    event CreditRetired(uint256 tokenId, address owner);
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);

    constructor() {
        _owner = msg.sender;
        _currentTokenId = 0;
    }

    modifier onlyOwner() {
        require(msg.sender == _owner, "Caller is not the owner");
        _;
    }

    function mintCredit(
        address recipient,
        string memory origin,
        string memory certificationStandard,
        string memory projectDetails,
        uint256 environmentalImpact
    ) public onlyOwner returns (uint256) {
        _currentTokenId++;
        uint256 newItemId = _currentTokenId;
        _tokenOwners[newItemId] = recipient;

        creditDetails[newItemId] = CreditDetails({
            origin: origin,
            certificationStandard: certificationStandard,
            projectDetails: projectDetails,
            environmentalImpact: environmentalImpact,
            retired: false
        });

        emit CreditMinted(newItemId, recipient, creditDetails[newItemId]);
        emit Transfer(address(0), recipient, newItemId);

        return newItemId;
    }

    function retireCredit(uint256 tokenId) public {
        require(_tokenOwners[tokenId] == msg.sender, "Caller is not the token owner");
        require(!creditDetails[tokenId].retired, "Credit is already retired");

        creditDetails[tokenId].retired = true;
        emit CreditRetired(tokenId, msg.sender);
    }

    function getCreditDetails(uint256 tokenId) public view returns (CreditDetails memory) {
        require(_tokenOwners[tokenId] != address(0), "Credit does not exist");
        return creditDetails[tokenId];
    }

    function getCurrentTokenId() public view returns (uint256) {
        return _currentTokenId;
    }

    function transferFrom(address from, address to, uint256 tokenId) public {
        require(_tokenOwners[tokenId] == from, "From address is not the owner");
        require(to != address(0), "Transfer to the zero address");

        _tokenOwners[tokenId] = to;
        emit Transfer(from, to, tokenId);
    }

    function ownerOf(uint256 tokenId) public view returns (address) {
        address owner = _tokenOwners[tokenId];
        require(owner != address(0), "Token does not exist");
        return owner;
    }
}
